import React from 'react'
import NavBar from '../functional/NavBar'

const LandingPage = () => {
    return(
        <div className="container">
            <NavBar />
            <h1 className="center">
                ItineraryApp
            </h1>
        </div>
    )
}

export default LandingPage;
